import react from 'react'

const ContentFragment = (props) => {
    return (
        <react.Fragment>
            Hello!
            {props.title}

            <div>
                {/* children are just photos */}
                {props.children}
            </div>

        </react.Fragment>
    )
}

export default ContentFragment;
